Trick for trying to get responses by cold-emailing professors:

Try catch someone in person (after class?), even if not someone who you think will likely take you on;

when they refuse, ask who else they think you could try (do you have a colleague who you think might be interested in having me as a XX?); 

next, email said other professors, starting with “Professor XX referred me to you.”
